/*
   File: rand850tables.h
      The first two tables are the low and high "words" when you multiply
      two, two-digit "words" together, yielding a four digit product.

      The high word table is pretty cool to look at if you have a fixed-width
      font and no wrapping.


      The third table is the table that needs to be changed if moving to an
      EBCDIC or a big-endian machine. Each index of the table is the two
      digits that represent that value. God help you if you try to move this
      code to a machine like the PDP-11. It is critically dependant on
      8-bit characters and 16-bit shorts.
*/

